import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import NavBar from "./Navbar/Navbar";

function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes></Routes>
    </BrowserRouter>
  );
}

export default App;
